import Home from './Home';
import Meeting from './pages/Meeting';
import Draft from './pages/Draft';
import { BrowserRouter, Routes, Route, Navigate } from "react-router-dom";
import './App.css';
import Login from './pages/Login'
import Signup from './pages/Signup'
import SignupUser from './pages/SignupUser';
import UserHome from './pages/UserHome';
import { useAuthContext } from './hooks/useAuthContext';

function App() {
  const {user} = useAuthContext()

  return (
    <BrowserRouter>
    <Routes>

        <Route path='/userhome' element={ user ? user.user.user_type === "admin"?<Home/>:<UserHome />: <Navigate to="/" />}/>
        <Route path='/userhome' element={ user ? user.user.user_type === "admin"?<UserHome />:<Home/>: <Navigate to="/" />}/>
        <Route path='/' element={ !user ? <Login/>  : <Navigate to="/dashboard" />}/>
        <Route path='/signupAdmin' element={ !user ? <Signup/> : <Navigate to="/dashboard" />}/>
        <Route path='/signupUser' element={ !user ? <SignupUser/> : <Navigate to="/userhome" />}/>
        <Route path='/createMeeting' element={<Meeting/>}/>
        <Route path='/draft' element={<Draft/>}/>
    </Routes>
  </BrowserRouter>

  );
}

export default App;
